import React from 'react'
import styled from 'styled-components';


const Container = styled.div``;
const Image = styled.div``;
const Info = styled.div``;
const Title = styled.div``;

export const Category = ({item}) => {
  return (

    <Container>
        <Image></Image>
        <Info>
            <Title>{item.title}</Title>
        </Info>
    </Container>
  )
}
